   _parent.攻击时移动(_parent._parent.行走X速度 * 1.5,_parent._parent.行走X速度 * 1.5);
}
*/

//本帧是进行一定特殊曲线移动的帧，不具有太多参考价值

//你需要改的值
速度上限 = _parent.行走X速度 * 2;
追踪持续帧 = 9;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限) * (7 + random(5)) / 10;
速度Z = (速度X * 距离Z / 距离X ) * (7 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X;
}
else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 1);
	上下加速度 = 上速度 * 0.5 / 追踪持续帧;
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 1);
	上下加速度 = 下速度 * 0.5 / 追踪持续帧;
}

//本帧是进行一定特殊曲线移动的帧，不具有太多参考价值

//你需要改的值
速度上限 = _parent.行走X速度 * 1.5;
追踪持续帧 = 5;

//自动计算的值
