速度Z = (速度X * 距离Z / 距离X ) * (7 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X;
	左右加速度 = -速度X * 0.5 / 追踪持续帧;
}
else
{
	右速度 = -速度X;
	左右加速度 = 速度X * 0.5 / 追踪持续帧;
}
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 1);
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 1);
}

