//进行特殊曲线移动
onClipEvent(enterFrame){
	if(_parent.上速度){
		_parent.上速度 -= _parent.上下加速度;
	}else if(_parent.下速度){
		_parent.下速度 -= _parent.上下加速度;
	} 
	if(_parent.左速度){
		_parent.左速度 -= _parent.左右加速度;
	}else if(_parent.右速度){
		_parent.右速度 -= _parent.左右加速度;
	} 
   _parent.攻击时四向移动(_parent.上速度, _parent.下速度, _parent.左速度, _parent.右速度);
}
